DROP DATABASE IF EXISTS market_yandex;
CREATE DATABASE market_yandex;
USE market_yandex;

DROP TABLE IF EXISTS users;
CREATE TABLE users (
	id BIGINT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY, 
    firstname VARCHAR(50),
    lastname VARCHAR(50),
    email VARCHAR(120) UNIQUE,
 	password_hash VARCHAR(100),
	phone BIGINT UNSIGNED UNIQUE, 
	
    INDEX users_firstname_lastname_idx(firstname, lastname)
);


DROP TABLE IF EXISTS catalogs;
CREATE TABLE catalogs (
  id bigint unsigned NOT NULL auto_increment PRIMARY KEY,
  name varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Название раздела',
  created_at datetime DEFAULT current_timestamp(),
  updated_at datetime DEFAULT current_timestamp() ON UPDATE current_timestamp()
); 

DROP TABLE IF EXISTS addresses;
CREATE TABLE addresses (
   id bigint unsigned NOT NULL auto_increment PRIMARY KEY,
   city varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT null,
   street_name varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Улица',
   home_number bigint(20) unsigned DEFAULT NULL,
   house_building bigint(20) COMMENT 'Корпус', 
   flat_number bigint(20)
);

DROP TABLE IF EXISTS storehouses;
CREATE TABLE storehouses (
  id bigint unsigned NOT NULL auto_increment PRIMARY KEY,
  name varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Название',
  addresses_id BIGINT unsigned DEFAULT null,
  created_at datetime DEFAULT current_timestamp(),
  updated_at datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  FOREIGN KEY (addresses_id) REFERENCES addresses(id)
);

DROP TABLE IF EXISTS category;
CREATE TABLE category (
  id bigint unsigned NOT NULL auto_increment PRIMARY KEY,
  age_category ENUM('0+', '6+', '12+', '16+', '18+')
); 

DROP TABLE IF EXISTS products;
CREATE TABLE products (
   id bigint unsigned NOT NULL auto_increment PRIMARY KEY,
   name varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
   description text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
   price decimal(11,2) DEFAULT NULL,
   catalog_id bigint unsigned DEFAULT NULL,
   created_at datetime DEFAULT current_timestamp(),
   updated_at datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
   FOREIGN KEY (catalog_id) REFERENCES catalogs(id)
);

DROP TABLE IF EXISTS products_category;
CREATE TABLE products_category (
	products_id BIGINT UNSIGNED NOT NULL,
    age_category_id BIGINT UNSIGNED NOT NULL,
    FOREIGN KEY (products_id) REFERENCES products(id),
    FOREIGN KEY (age_category_id) REFERENCES category(id),
    PRIMARY KEY (products_id, age_category_id)
);

DROP TABLE IF EXISTS storehouses_products;
CREATE TABLE storehouses_products (
   id bigint unsigned NOT NULL auto_increment PRIMARY KEY,
   storehouse_id bigint unsigned DEFAULT NULL,
   product_id bigint unsigned DEFAULT NULL,
   value bigint unsigned DEFAULT NULL COMMENT 'Запас товарной позиции на складе',
   created_at datetime DEFAULT current_timestamp(),
   updated_at datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
   FOREIGN KEY (storehouse_id) REFERENCES storehouses(id),
   FOREIGN KEY (product_id) REFERENCES products(id)
); 

DROP TABLE IF EXISTS photo;
CREATE TABLE photo (
	id BIGINT unsigned NOT NULL auto_increment PRIMARY KEY,
	users_id bigint unsigned DEFAULT NULL,
    filename VARCHAR(255),
    `size` INT,
    created_at DATETIME DEFAULT NOW(),
    updated_at datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
    FOREIGN KEY (users_id) REFERENCES users(id)
);


DROP TABLE IF EXISTS profiles;
CREATE TABLE profiles (
	id BIGINT unsigned NOT NULL auto_increment PRIMARY KEY,
    gender CHAR(1),
    birthday DATE,
    photo_id bigint unsigned DEFAULT NULL,
    created_at datetime DEFAULT current_timestamp(),
    updated_at datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
    FOREIGN KEY (id) REFERENCES users(id) on update cascade on delete cascade,
    FOREIGN KEY (photo_id) REFERENCES photo(id)
);

DROP TABLE IF EXISTS profiles_addresses;
CREATE TABLE profiles_addresses (
	profiles_id BIGINT UNSIGNED NOT NULL,
    addresses_id BIGINT UNSIGNED NOT NULL,
    FOREIGN KEY (profiles_id) REFERENCES profiles(id),
    FOREIGN KEY (addresses_id) REFERENCES addresses(id),
    PRIMARY KEY (profiles_id, addresses_id)
);

DROP TABLE IF EXISTS reviews;
CREATE TABLE reviews (
   id bigint unsigned NOT NULL auto_increment PRIMARY KEY,
   description text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
   raiting ENUM('0', '1', '2', '3', '4', '5'),
   created_at datetime DEFAULT current_timestamp(),
   updated_at datetime DEFAULT current_timestamp() ON UPDATE current_timestamp()
);

DROP TABLE IF EXISTS profiles_reviews;
CREATE TABLE profiles_reviews (
  profiles_id bigint unsigned NOT NULL,
  reviews_id bigint unsigned NOT NULL,
  PRIMARY KEY (profiles_id, reviews_id),
  FOREIGN KEY (profiles_id) REFERENCES profiles(id),
  FOREIGN KEY (reviews_id) REFERENCES reviews(id)
);

DROP TABLE IF EXISTS products_reviews;
CREATE TABLE products_reviews (
  reviews_id bigint unsigned NOT NULL,
  products_id bigint unsigned NOT NULL,
  PRIMARY KEY (reviews_id, products_id),
  FOREIGN KEY (reviews_id) REFERENCES reviews(id),
  FOREIGN KEY (products_id) REFERENCES products(id)
);

DROP TABLE IF EXISTS promo_code;
CREATE TABLE promo_code (
  id bigint unsigned NOT NULL auto_increment PRIMARY KEY,
  user_id bigint unsigned DEFAULT NULL,
  discount float unsigned DEFAULT NULL COMMENT 'Величина скидки от 0.0 до 1.0',
  started_at datetime DEFAULT NULL,
  finished_at datetime DEFAULT NULL,
  created_at datetime DEFAULT current_timestamp(),
  updated_at datetime DEFAULT current_timestamp() ON UPDATE current_timestamp()
);

DROP TABLE IF EXISTS profiles_promo_code;
CREATE TABLE profiles_promo_code (
  profiles_id bigint unsigned NOT NULL,
  promo_code_id bigint unsigned NOT NULL,
  PRIMARY KEY (profiles_id, promo_code_id),
  FOREIGN KEY (profiles_id) REFERENCES profiles(id),
  FOREIGN KEY (promo_code_id) REFERENCES promo_code(id)
);

DROP TABLE IF EXISTS products_promo_code;
CREATE TABLE products_promo_code (
  products_id bigint unsigned NOT NULL,
  promo_code_id bigint unsigned NOT NULL,
  PRIMARY KEY (products_id, promo_code_id),
  FOREIGN KEY (products_id) REFERENCES products(id),
  FOREIGN KEY (promo_code_id) REFERENCES promo_code(id)
);

DROP TABLE IF EXISTS orders_delivery;
CREATE TABLE orders_delivery (
   id bigint unsigned NOT NULL auto_increment PRIMARY KEY,
   delivery_date datetime DEFAULT current_timestamp(),
   address_id bigint unsigned DEFAULT NULL,
   delivered_at datetime DEFAULT '1900-01-01',
   FOREIGN KEY (address_id) REFERENCES addresses(id)
);

DROP TABLE IF EXISTS orders;
CREATE TABLE orders (
   id bigint unsigned NOT NULL auto_increment PRIMARY KEY,
   delivery_id bigint unsigned DEFAULT NULL,
   created_at datetime DEFAULT current_timestamp(),
   updated_at datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
   FOREIGN KEY (delivery_id) REFERENCES orders_delivery(id)
);

DROP TABLE IF EXISTS profiles_orders;
CREATE TABLE profiles_orders (
   profiles_id bigint unsigned NOT NULL,
   orders_id bigint unsigned NOT NULL,
   PRIMARY KEY (profiles_id, orders_id),
   FOREIGN KEY (profiles_id) REFERENCES profiles(id),
   FOREIGN KEY (orders_id) REFERENCES orders(id)
);

DROP TABLE IF EXISTS orders_products;
CREATE TABLE orders_products (
   id bigint unsigned NOT NULL auto_increment PRIMARY KEY,
   order_id bigint unsigned DEFAULT NULL,
   product_id bigint unsigned DEFAULT NULL,
   total int(10) unsigned DEFAULT 1 COMMENT 'Количество заказанных товарных позиций',
   created_at datetime DEFAULT current_timestamp(),
   updated_at datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
   FOREIGN KEY (order_id) REFERENCES orders(id),
   FOREIGN KEY (product_id) REFERENCES products(id)
);

